import { Button, Container, TextField, Typography } from "@mui/material";
import { makeStyles } from "@mui/styles";
import React from "react";
const useStyles = makeStyles({
  btn: {
    backgroundImage:
      "linear-gradient(to right, #1FA2FF 0%, #12D8FA  51%, #1FA2FF  100%)",
    margin: "10px",
    padding: " 15px 45px",
    textAlign: "center",
    textTransform: " uppercase",
    transition: "0.5s",
    backgroundSize: "200% auto",
    color: "white",
    boxShadow: "0 0 20px #eee",
    borderRadius: " 10px",
    display: " block",

    "&:hover": {
      backgroundPosition:
        "right center" /* change the direction of the change here */,
      color: "#fff",
      textDecoration: "none",
    },
  },
});
const Todolist = () => {
  const classes = useStyles();
  return (
    <Container>
      <Typography variant="h3" gutterBottom component="h3" color="primary">
        Todo List
      </Typography>
      <form>
        <TextField
          variant="outlined"
          id="name"
          label="Name"
          fullWidth
          required
          helperText="Please Enter Your Name"
          margin="dense"
        />
        <TextField
          variant="outlined"
          id="price"
          label="Price"
          fullWidth
          required
          helperText="Please Enter Your Name"
          margin="dense"
        />
        <Button variant="contained" fullWidth className={classes.btn}>
          Add List
        </Button>
      </form>
    </Container>
  );
};

export default Todolist;
